subproject.description:
The parliamentary strengthening project aimed to improve the capacity of the national parliamentary administration to support MPs in the fulfillment of their constitutional roles—representation, law making and oversight. The project was designed to address five outcomes, namely:

1.	Effective and efficient parliamentary services, management and administration;
2.	Representative role of the Solomon Islands Parliamentarians strengthened;
3.	Law making procedures of Solomon Islands Parliament strengthened;
4.	Capacity of the Solomon Islands Parliament to exercise its oversight role strengthened; and
5.	Increased representation of women and gender perspective in governance.
